import React, { Component } from "react";
import API from "../../utils/API";

class Books extends Component {
  state = {
      name: ""
  };

  componentDidMount() {
    console.log("Page mounted");
  }

  render() {
    return (
      <Container>
        <Login onClick={ () => this.handleClick}/>
      </Container>
    );
  }
}

export default Login;
